var handleCalendar = function () {
        "use strict";
        $("#external-events .fc-event").each(function () {
            $(this).data("event", {
                title: $.trim($(this).text()),
                stick: !0
            }), $(this).draggable({
                zIndex: 999,
                revert: !0,
                revertDuration: 0
            })
        });
        var t = new Date,
            e = t.getFullYear(),
            n = t.getMonth() + 1;
        n = 10 > n ? "0" + n : n, $("#calendar").fullCalendar({
            header: {
                left: "month,agendaWeek,agendaDay",
                center: "title",
                right: "prev,today,next "
            },
            droppable: !0,
            drop: function () {
                $(this).remove()
            },
            selectable: !0,
            selectHelper: !0,
            select: function (t, e) {
                var n, a = prompt("Event Title:");
                a && (n = {
                    title: a,
                    start: t,
                    end: e
                }, $("#calendar").fullCalendar("renderEvent", n, !0)), $("#calendar").fullCalendar("unselect")
            },
            editable: !0,
            eventLimit: !0,
            events: [{
                title: "All Day Event",
                start: e + "-" + n + "-01"
            }, {
                title: "Long Event",
                start: e + "-" + n + "-07",
                end: e + "-" + n + "-10"
            }, {
                id: 999,
                title: "Repeating Event",
                start: e + "-" + n + "-09T16:00:00"
            }, {
                id: 999,
                title: "Repeating Event",
                start: e + "-" + n + "-16T16:00:00"
            }, {
                title: "Conference",
                start: e + "-" + n + "-11",
                end: e + "-" + n + "-13"
            }, {
                title: "Meeting",
                start: e + "-" + n + "-12T10:30:00",
                end: e + "-" + n + "-12T12:30:00"
            }, {
                title: "Lunch",
                start: e + "-" + n + "-12T12:00:00"
            }, {
                title: "Meeting",
                start: e + "-" + n + "-12T14:30:00"
            }, {
                title: "Happy Hour",
                start: e + "-" + n + "-12T17:30:00"
            }, {
                title: "Dinner",
                start: e + "-" + n + "-12T20:00:00"
            }, {
                title: "Birthday Party",
                start: e + "-" + n + "-13T07:00:00"
            }, {
                title: "Click for Google",
                url: "http://google.com/",
                start: e + "-" + n + "-28"
            }]
        })
    },
    PageDemo = function () {
        "use strict";
        return {
            init: function () {
                handleCalendar()
            }
        }
    }();
